(1, 3, 'This is my test artcile', '<p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Duis hendrerit et dui suscipit faucibus. Mauris euismod leo quis purus dignissim, auctor porttitor tellus malesuada. Morbi maximus placerat dui vel porttitor. Quisque mattis rutrum diam non semper. Etiam justo metus, maximus eu tortor ultrices, placerat gravida eros. Vivamus arcu ipsum, rutrum vel ex suscipit, molestie lobortis lectus. Etiam commodo elementum elit sit amet pellentesque. Cras vestibulum, quam eget pretium lacinia, lorem arcu pretium risus, sed sagittis magna mauris et libero. Sed sit amet velit viverra, malesuada nulla rutrum, feugiat ex. Nam id iaculis odio. Donec ultrices risus ac turpis accumsan ullamcorper. In dictum id mi et varius. Vivamus volutpat eros vel mi feugiat, vel congue lorem sagittis.</p><p>Vivamus pharetra quis sapien vitae varius. Proin finibus sollicitudin velit in sodales. Mauris nec tempus neque. Integer volutpat ut lectus vel eleifend. Quisque a condimentum odio, vitae suscipit diam. Pellentesque vitae orci maximus, venenatis turpis eget, consequat ipsum. Fusce risus ipsum, pretium vel lectus consectetur, finibus lacinia felis.</p>', 'This is a description of my artcile', '[{\"filename\":\"Screenshot 2025-07-21 at 10.55.08\\u202fAM.png\",\"drive_id\":\"1jfwaHC4JhEnwBaQeMlD-CEcR6HbxbNKj\",\"local_path\":\"uploads\\/articles\\/3\\/2025\\/07\\/Screenshot_2025-07-21_at_10.55.08___AM.png\",\"thumb_path\":\"uploads\\/articles\\/3\\/2025\\/07\\/thumbs\\/Screenshot_2025-07-21_at_10.55.08___AM.png\"}]', 'approved', '', '2025-07-23 01:56:56', '2025-07-23 02:39:26', '66.152.148.22'),
(2, 3, 'DISREGARD: Testing Article', '<p>Wanted to test this, disregard.</p><p>Blah blah blah</p><p>Testing 123</p><p>MediaHub Rocks</p><p>Let\'s Goooooo!</p>', 'just wanted to test the submission of an article', '[]', 'submitted', NULL, '2025-07-24 18:55:29', NULL, '68.109.134.6');
